import React, {useEffect, useState, useRef} from 'react';
const myImg = 'data:image/jpeg;base64,\n'
const baseImg = 'data:image/jpg;base64,\n';
const Main = (props) => {
  const {socket} = props;
  const [image, setImage] = useState(myImg);
  const canvasRef = useRef(null);
  const imgRef = useRef(null);

  const drawRect = (color, x1, y1, x2, y2) => {
    socket.emit('parse_img');
    let canvas = canvasRef.current;
    let context = canvas.getContext('2d');
    context.beginPath();
    const width = 640 * (x2 - x1);
    const height = 480 * (y2 - y1);
    context.strokeStyle = color;
    context.strokeRect(640 * x1, 640 * y1, width, height);
    context.stroke();
  };

  useEffect(() => {
    socket.on('data', (data) => {
      setImage(data.img);
    });
    socket.on('test', (data) => {
      console.log(data.img);
      setImage('data:image/jpg;base64,' + data.img);
    })
    }, []);

  useEffect(() => {

  }, []);
  return (
    <div className="main">
      <canvas className="detections" ref={canvasRef} width={640} height={480} />
      <img className="camera_image" ref={imgRef} src={ baseImg} />
      <button onClick={() => drawRect('#09d3ac', 0.38, 0.6, 0.41, 0.62)}>ВЫПУСКАЙТЕ БЫЧКА!</button>
    </div>
  );
};

export default Main;
